/* ---------- routes ---------- */
app.post('/api/generate-plan', async (req, res) => {
  try {
    const user = req.body;
    const plan = generatePlan(user);
    const browser = await puppeteer.launch({
      executablePath: process.env.PUPPETEER_EXEC_PATH || '/usr/bin/chromium-browser',
      args: ['--no-sandbox', '--disable-setuid-sandbox']
    });
    const page = await browser.newPage();
    await page.setContent(buildPDFHTML(user, plan), { waitUntil: 'networkidle0' });
    const pdf = await page.pdf({ format: 'A4', printBackground: true });
    await browser.close();

    res.set({
      'Content-Type': 'application/pdf',
      'Content-Disposition': 'attachment; filename="HoxFitness-Plan.pdf"'
    });
    res.send(pdf);
  } catch (err) {
    res.status(500).json({ error: err.message });
  }
});

app.post('/api/generate-plan-starter', async (req, res) => {
  try {
    const user = req.body;
    const plan = generateIndianPlan(user);
    const browser = await puppeteer.launch({
      executablePath: process.env.PUPPETEER_EXEC_PATH || '/usr/bin/chromium-browser',
      args: ['--no-sandbox', '--disable-setuid-sandbox']
    });
    const page = await browser.newPage();
    await page.setContent(buildPDFHTML(user, plan), { waitUntil: 'networkidle0' });
    const pdf = await page.pdf({ format: 'A4', printBackground: true });
    await browser.close();

    res.set({
      'Content-Type': 'application/pdf',
      'Content-Disposition': 'attachment; filename="HoxFitness-Indian-Plan.pdf"'
    });
    res.send(pdf);
  } catch (err) {
    res.status(500).json({ error: err.message });
  }
});

app.get('/api/generate-plan', (_req, res) => {
  res.json({ message: 'Use POST with JSON body to generate a plan.' });
});

const PORT = process.env.PORT || 4000;
app.listen(PORT, () =>
  console.log(`🚀 HoxFitness PDF ready → http://localhost:${PORT}/index.html`)
);
